function __InitAreaServer(value, ControlID)
{
    var obj1 = $(ControlID + "_d1"), obj2 = $(ControlID + "_d2"), obj3 = $(ControlID + "_d3");
    
    Forms.initDropList(obj1, __getAreaCodesName(""), __getAreaCodesID(""), value.substr(0, 2) + "0000", "地区不限", "");
    obj2.style.display = obj3.style.display = (value!='')?'':'none';
    var value2 = obj1.options[obj1.selectedIndex].value;
    if(value2=="")value2=null;
    Forms.initDropList(obj2, __getAreaCodesName(value2), __getAreaCodesID(value2), value.substr(0, 4) + "00", "", "");
    
    var value3 = obj2.options[obj2.selectedIndex].value;
    if(value3=="")value3=null;
    Forms.initDropList(obj3, __getAreaCodesName(value3), __getAreaCodesID(value3), value, "", "");
}

//JS
function __InitAreaJsServer(ControlID, value, note)
{
    if(document.readyState!="complete")return;
    
    var layer = $(ControlID + "_layer");
    if(!layer)
    {
        layer = document.createElement("div");
	    //layer.style.display='none';
	    layer.id = ControlID + "_layer";
	    layer.className = "mms1";
	    layer.style.zIndex='999';
	    layer.innerHTML += __getAreaCodesIDServer(ControlID, value, note);
	    document.body.appendChild(layer);
	    Forms.initDropList($(ControlID + '_d1'), __getAreaCodesName(""), __getAreaCodesID(""), value.substr(0,2) + "0000");
	    $(ControlID + '_d1').onchange();
	}
	else
	{
	    layer.style.display = "";
	}
	
	InitObjectPos(layer);
}

function __getAreaCodesIDServer(ControlID, value, note)
{
    var ids = __getAreaCodesID(value);
    var names = __getAreaCodesName(value);
	var htmlDiv = '';
	
	htmlDiv += '<div class="mms">';
	htmlDiv += '<div class="top"><div class="left">请选择' + note + '</div><div class="right"><img src="images/gb.gif" onclick="javascript:hideObject(\'' + ControlID + '_layer\');" style="cursor:pointer;" /></div></div>';
	htmlDiv += '<div style="padding-left:3px;background-Color:#F6F6F6;">请选择地点:<select name="' + ControlID + '_d1" id="' + ControlID + '_d1" onchange="__InitAreaChildServer(\'' + ControlID + '\', this.value)"></select></div>'
	htmlDiv += '<div id="' + ControlID + '_td"></div>'
	htmlDiv += '<div class="clear"></div></div>';
	
	return htmlDiv;
}
function __setAreaCodeValue(ControlID, value, name)
{
    $(ControlID + "_hid").value = value;
    $(ControlID + "_h1").innerHTML = name;
}
function __InitAreaChildServer(ControlID, value)
{
    var ids = __getAreaCodesID(value);
    var names = __getAreaCodesName(value);
	var htmlDiv = '';
	
	htmlDiv +='<div class="data">';
	
	for(var i = 1;i <= ids.length;i++)
	{
		htmlDiv += '<div class="pera" onmouseover="this.style.color=\'#ff7300\'" onmouseout="this.style.color=\'\'" onclick="javascript:__setAreaCodeValue(\'' + ControlID + '\', \'' + ids[i-1] + '\', \'' + names[i-1] + '\');hideObject(\'' + ControlID + '_layer\');">' + names[i-1] + '</div>';
	}
	htmlDiv +='</div>';
	
	$(ControlID + "_td").innerHTML = htmlDiv;
}

function __InitAreaCodeTextServer(ControlID, value)
{
    if(value=="")return;
    var ids = __getAreaCodesID(value.substr(0,4) + "00");
    var names = __getAreaCodesName(value.substr(0,4)+"00");
    var obj = $(ControlID);
    if(!obj)return;
    
    for(var i=0;i<ids.length;i++)
    {
        if(value.substr(0,4) == ids[i].substr(0,4))
        {
            obj.innerHTML = names[i];
            break;
        }
    }
}
//前台显示地区名称
function __getAreaNameFromValue(value) {
    value = value.toString();
    var retval = "";
    var i=4;
    while(i>=2)
    {
        if(value.substring(i)=="00")
        {
            i-=2;
            continue;
        }
        var ids = __getAreaCodesID(value.substr(0,i) + "00" + (i==2?"00":""));
        var names = __getAreaCodesName(value.substr(0,i)+"00" + (i==2?"00":""));
        for(var ii=0;ii<ids.length;ii++)
        {
            if(value == ids[ii])
            {
                retval = names[ii] + retval;
                continue;
            }
        }
        value = value.substr(0,i) + "00" + (i==2?"00":"");
        i-=2;
    }
    if(retval=="")retval = "不限";
    document.write(retval);
}

function __getAreaNameFromValue1(value) {
    value = value.toString();
    var retval = "";
    var i = 4;
    while (i >= 2) {
        if (value.substring(i) == "00") {
            i -= 2;
            continue;
        }
        var ids = __getAreaCodesID(value.substr(0, i) + "00" + (i == 2 ? "00" : ""));
        var names = __getAreaCodesName(value.substr(0, i) + "00" + (i == 2 ? "00" : ""));
        for (var ii = 0; ii < ids.length; ii++) {
            if (value == ids[ii]) {
                retval = names[ii] + retval;
                continue;
            }
        }
        value = value.substr(0, i) + "00" + (i == 2 ? "00" : "");
        i -= 2;
    }
    if (retval == "") retval = "不限";
     return retval;
}